import React from "react";

// Define props type
interface FooterProps {
  year: number;
  companyName: string;
}

const Footer: React.FC<FooterProps> = ({ year, companyName }) => {
  return (
    <footer className="footer">
      <div className="footer-content">
        {/* Logo */}
        <div className="footer-logo">
          <img src="/logo.png" alt={`${companyName} Logo`} />
        </div>

        {/* Thông tin công ty */}
        <div className="footer-info">
          <p>© {year} {companyName} - Đặt vé xe khách nhanh chóng & tiện lợi.</p>
          <p>Địa chỉ: 123 Đường ABC, Quận XYZ, Thành phố Hồ Chí Minh</p>
          <p>Email: support@{companyName.toLowerCase().replace(/\s+/g, "")}.com</p>
          <p>Hotline: 1900 123 456</p>
        </div>

        {/* Liên kết mạng xã hội */}
        <div className="footer-social">
          <a href="https://facebook.com" target="_blank" rel="noopener noreferrer">Facebook</a>
          <a href="https://twitter.com" target="_blank" rel="noopener noreferrer">Twitter</a>
          <a href="https://instagram.com" target="_blank" rel="noopener noreferrer">Instagram</a>
        </div>
      </div>
    </footer>
  );
};

export default Footer;
